/**
* login state内のstatus定義。SUCCESS(成功)、FAILURE(失敗)、NOTYET(未実施)。
*/
export const LOGIN_STATUS={
  SUCCESS:"SUCCESS",
  FAILURE:"FAILURE",
  NOTYET:"NOTYET"
}

import {LOGIN_STATUS} from '../const/login'
import {LOGIN_SUCCESS,LOGIN_FAILURE,LOGIN_REQUESTED,LOGOUT_REQUESTED} from '../action/login'

/**
* ログイン reducer
* @see http://qiita.com/yasuhiro-okada-aktsk/items/9d9025cb58ffba35f864
* @param {Object} state 変更前のstate
* @param {Object} action dispatchされたaction
* @return {Object} 変更後のstate
*/
export default function login(state={status:"NOTYET",user:{}}, action){
  switch(action.type){
    case LOGIN_SUCCESS:
      return {status:LOGIN_STATUS.SUCCESS,user:action.payload};
    case LOGIN_FAILURE:
      return {status:LOGIN_STATUS.FAILURE,user:{}};
    case LOGOUT_REQUESTED:
      return {status:LOGIN_STATUS.NOTYET,user:{}};
    case LOGIN_REQUESTED:
      return {status:LOGIN_STATUS.NOTYET,user:{}};
    default:
      return state;
  }
}

import { combineReducers } from 'redux'
import login from './login';

/**
* 各reducerを結合してひとまとめにしてexportする
* @see http://qiita.com/kuy/items/59c6d7029a10972cba78
*/
export default combineReducers({
  login
})

import {take,put,takeEvery} from 'redux-saga/effects'
import {LOGIN_REQUESTED,loginSuccess,loginFailure} from '../action/login'
/**
* login要求を受け付けるSaga
* @see http://qiita.com/kuy/items/716affc808ebb3e1e8ac
*/
export function* loginSaga(){
  /*
  * LOGIN_REQUESTED(ログイン要求)アクションを常に待ち続け、
  * dispatchされたらloginTaskにactionを渡して実行する
  */
  yield takeEvery(LOGIN_REQUESTED,loginTask);
}
/**
* APIに対してID/Passを問い合わせて、
* 成功すればユーザー情報を元にLOGIN_SUCCESS(ログイン成功)アクションをput(dispatch)する
* @param {object} action LOGIN_REQUESTED(ログイン要求)アクション
*/
function* loginTask(action){
  /*
  * TODO ダミーロジック。実際にはAPIにアクセスしてログイン成否をハンドリングする必要あり。
  * ここではtest/testのみログイン可能とする。
  */
  if(action.payload.id == "test" && action.payload.pass == "test"){
    const dummyUserInfo = {userid:"test", token:"dummy"};
    //LOGIN_SUCCESSアクションをput(dispatch)
    yield put(loginSuccess(dummyUserInfo));
  }else{
    //LOGIN_FAILUREアクションをput(dispatch)
    yield put(loginFailure());
  }
}

import {fork} from 'redux-saga/effects'
import {loginSaga} from './login'

/**
* Sagaの起点ポイント。ここから各Sagaをforkする
* @see http://qiita.com/kuy/items/716affc808ebb3e1e8ac
*/
export default function* rootSaga(){
  yield fork(loginSaga);
}

import { createStore, applyMiddleware } from 'redux'
import createSagaMiddleware from 'redux-saga'
import logger from 'redux-logger'
import rootReducer from '../reducer/root'
import rootSaga from '../saga/root'
import {LOGIN_STATUS} from '../const/login'


/**
* reduxのstoreのセットアップ。redux-saga対応。
* @see http://qiita.com/kuy/items/716affc808ebb3e1e8ac
*/
export function configureStore() {
  const sagaMiddleware = createSagaMiddleware();
  const store = createStore(
    rootReducer,
    {
      login:{status:LOGIN_STATUS.NOTYET, user:{}}
    },
    applyMiddleware(
      sagaMiddleware, logger()
    )
  );
  sagaMiddleware.run(rootSaga);
  return store;
};
